import React from "react";
import CommonComp from "./CommonComp";
import about from"../src/Images.gif"

const About = () => {
  return (
    <>
      <CommonComp name= "Welcome to About page" imgsrc={home} visit={"/contact"} btname="Contact Now"/>
    </>
  );
};

export default About;
